import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { setOrderHistory } from "../../store/orderSlice";

const OrderHistory = () => {
  const dispatch = useDispatch();
  const orders = useSelector((state) => state.order.orderHistory);

  useEffect(() => {
    dispatch(orderActions.getOrderHistory());
  }, [dispatch]);

  return (
    <div className="order-history">
      <h2>주문 내역</h2>
      {orders.length === 0 ? (
        <p>주문 내역이 없습니다.</p>
      ) : (
        <ul>
          {orders.map((order) => (
            <li key={order.id}>
              <p>주문자: {order.name}</p>
              <p>주소: {order.address}</p>
              <p>전화번호: {order.phone}</p>
              <p>총 금액: {order.totalAmount}원</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default OrderHistory;
